  end
  function eventPlayerDied(n)
  tfm.exec.setPlayerScore(n,-2,true)
  table[n]=1
  life[n]=0
  e=e-1
  for name, player in pairs(tfm.get.room.playerList) do
  if(table[name]==0) then
  num=num+1
  winner=name
  end
  end
  function eventPlayerLeft(n)
  table[n]=1
  life[n]=0
  e=e-1
  for name, player in pairs(tfm.get.room.playerList) do
  if(table[name]==0) then
  num=num+1
  winner=name
  end
  end
  end
