  tfm.exec.giveCheese(winner)
  ui.addTextArea(1, "<p align='center'><font size='70' color='#ff0000'>"..winner.." Won!</font></p>", nil, 50, 150, 700, 500, 0x324650, 0x000000, 0, true,true)
